I have a Tooltip component that I want to use in different places in my NextJS application. However, I want to ensure that when a new Tooltip is opened, any previously opened Tooltip is closed. Since these Tooltips are used in different places and don't have a shared scope or context, they are isolated from each other.

To achieve this, I can use React Context to manage the state of the Tooltips. Here's how I can do it:

1. Create a TooltipContext to manage the state of the Tooltips.
2. Create a TooltipProvider component that will wrap the entire application and provide the TooltipContext to all the components.
3. Create a Tooltip component that will use the TooltipContext to manage its state.

Here's the code to implement this:

```jsx
import React, { createContext, useState, useContext } from 'react';

// Create TooltipContext
const TooltipContext = createContext();

// Create TooltipProvider component
const TooltipProvider = ({ children }) => {
  const [tooltipOpen, setTooltipOpen] = useState(false);

  const openTooltip = () => {
    setTooltipOpen(true);
  };

  const closeTooltip = () => {
    setTooltipOpen(false);
  };

  return (
    <TooltipContext.Provider value={{ tooltipOpen, openTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

// Create Tooltip component
const Tooltip = ({ children }) => {
  const { tooltipOpen, openTooltip, closeTooltip } = useContext(TooltipContext);

  const handleMouseEnter = () => {
    openTooltip();
  };

  const handleMouseLeave = () => {
    closeTooltip();
  };

  return (
    <div onMouseEnter={handleMouseEnter} onMouseLeave={handleMouseLeave}>
      {children}
      {tooltipOpen && <div className="tooltip">This is a tooltip</div>}
    </div>
  );
};

// Wrap the entire application with TooltipProvider
const MyApp = ({ Component, pageProps }) => {
  return (
    <TooltipProvider>
      <Component {...pageProps} />
    </TooltipProvider>
  );
};

export default MyApp;
```

In this code, the `TooltipProvider` component manages the state of the Tooltips using the `TooltipContext`. The `Tooltip` component uses the `TooltipContext` to manage its state and display the tooltip when the mouse enters the component and hide it when the mouse leaves the component.

By wrapping the entire application with the `TooltipProvider` component, all the components in the application will have access to the `TooltipContext` and can use the `Tooltip` component to display tooltips.

