```javascript
import { useEffect, useRef } from 'react';

const YourComponent = ({ cursor, tl, $portfolioNext, $portfolioCurrent }) => {
  const lastRun = useRef(Date.now());

  useEffect(() => {
    const now = Date.now();
    if (now - lastRun.current >= 600) {
      lastRun.current = now;

      tl.set($portfolioNext.current, {
