using System;
using System.IO;
using System.Net;
using System.Net.Sockets;
using System.Text;

class TcpClientExample
{
    static void Main()
    {
        try
        {
            // Create a TcpClient to connect to the server
            using (TcpClient client = new TcpClient("192.168.0.3", 40957))
            {
                using (NetworkStream stream = client.GetStream())
                using (StreamReader reader = new StreamReader(stream))
                using (StreamWriter writer = new StreamWriter(stream) { AutoFlush = true })
                {
                    // Read the welcome message
                    string welcomeMessage = reader.ReadLine();
                    Console.WriteLine("Server: " + welcomeMessage);

                    // Send login message
                    writer.WriteLine("LGIN x-stream");
                    string loginResponse = reader.ReadLine();
                    Console.WriteLine("Server: " + loginResponse);

                    if (loginResponse == "Password correct")
                    {
                        // Send GTMP? message
                        writer.WriteLine("GTMP?");
                        string temperatureResponse = reader.ReadLine();
                        Console.WriteLine("Server: " + temperatureResponse);

                        // Send LOGOUT message
                        writer.WriteLine("LOGOUT");
                    }
                    else
                    {
                        Console.WriteLine("Login failed. Exiting...");
                    }
                }
            }
        }
        catch (Exception e)
        {
            Console.WriteLine("Error: " + e.Message);
        }
    }
}
```

